.message-container{
    min-height: 85vh;
    padding: 0 20px;
}
.message-container-title{
    font-size: 16px;
    padding: 20px 0;
    font-weight: 600;
}
.message-container-list{
    cursor:pointer;
    height: 110px;
    border-top: 1px solid #eeeeee;
    display: flex;
    justify-content: space-between;
    align-items: center;
}
.message-container-list-left{
    width: 800px;
    display: flex;
}
.message-container-list-right{
    width: 130px;
}
.message-container-list-text{
    margin-left: 10px;
}
.message-nickname{
    font-weight: 600;
    font-size: 18px;
    padding-bottom: 5px;
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
}
.message-content{
    font-size: 16px;
    padding-bottom: 15px;
    color: #555555;
    width: 710px;
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
}
.message-time{
    font-size: 13px;
    color: #555555;
}
